IL SEGRETO SVEDESE

Björk & Berries è un marchio di profumi e prodotti per la cura della pelle che trae le sue origini nella natura, nella cultura e nello stile di vita svedesi. Tutto è iniziato con un profumo naturale creato a partire da foglie di betulla raccolte a mano. Oggi Björk & Berries offre una vasta gamma di prodotti nell’ambito della profumazione e della cura del viso e del corpo.
Il segreto della produzione Björk & Berries è da ricercare negli esperti di cosmesi che traggono ispirazione dal misticismo e dai vecchi rimedi delle foreste svedesi, e trasformano ingredienti naturali come betulla, amamelide e argilla bianca in efficaci prodotti ecoluxury.
Scegliere i prodotti Björk & Berries significa sperimentare e provare l’unicità della natura svedese, scoprendo la forza del minimalismo scandinavo. Minimal come gli ingredienti utilizzati: il più naturali e biologici possibili, senza rinunciare all’efficacia e alla filosofia Ecoluxury*.

Björk & Berries ist eine ecoluxury Beauty-Marke aus Schweden. Es begann alles mit handgepflückten Birkenblättern, die schon eine lange Tradition in der schwedischen Hautpflege haben. Das Ziel von Björk & Berries ist es, natürliche, biologische und per Hand geerntete Inhaltsstoffe zu verwenden und innovative Produkte zu entwickeln, die auch durch ihr einmaliges Design bestechen.

